import React, { useState } from 'react';
import { Box, Button, Typography, Card, CardContent, TextField, Snackbar, Alert } from '@mui/material';
import { useHistory } from 'react-router-dom';
import axios from 'axios';

export default function CadastroClinica() {
  const history = useHistory();
  const [form, setForm] = useState({ nome: '', email: '', senha: '', telefone: '', cnpj: '', cep: '' });
  const [snackbar, setSnackbar] = useState({ open: false, message: '', severity: 'info' });
  const [loading, setLoading] = useState(false);

  const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await axios.post('http://localhost:5000/api/auth/cadastro-clinica', form);
      setSnackbar({ open: true, message: res.data.message, severity: 'success' });
      setTimeout(() => history.push('/login'), 1500);
    } catch (err) {
      setSnackbar({ open: true, message: err.response?.data?.error || 'Erro ao cadastrar.', severity: 'error' });
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: 'none' }}>
      <Card sx={{ p: 4, borderRadius: 5, boxShadow: 8, minWidth: 320, maxWidth: 400, background: 'rgba(30,34,44,0.92)', backdropFilter: 'blur(8px)' }}>
        <CardContent>
          <Typography variant="h5" fontWeight={700} color="#fff" align="center" mb={2}>
            Cadastro de Clínica
          </Typography>
          <Box component="form" onSubmit={handleSubmit} display="flex" flexDirection="column" gap={2} mt={2}>
            <TextField label="Nome da Clínica" name="nome" value={form.nome} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff' }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <TextField label="E-mail" name="email" type="email" value={form.email} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff' }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <TextField label="Senha" name="senha" type="password" value={form.senha} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff' }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <TextField label="Telefone" name="telefone" value={form.telefone} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff' }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <TextField label="CNPJ" name="cnpj" value={form.cnpj} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff' }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <TextField label="CEP" name="cep" value={form.cep} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff' }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <Button type="submit" variant="contained" size="large" sx={{ borderRadius: 3, fontWeight: 700, fontSize: 18, py: 1.5, background: 'linear-gradient(90deg, #1976d2 60%, #0d47a1 100%)', mt: 2 }} disabled={loading}>
              {loading ? 'Cadastrando...' : 'Cadastrar'}
            </Button>
            <Button variant="text" sx={{ color: '#b0b8c1' }} onClick={() => history.push('/login')}>
              Já tenho uma conta
            </Button>
          </Box>
        </CardContent>
      </Card>
      <Snackbar open={snackbar.open} autoHideDuration={2500} onClose={() => setSnackbar({ ...snackbar, open: false })} anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}>
        <Alert severity={snackbar.severity} sx={{ width: '100%' }}>
          {snackbar.message}
        </Alert>
      </Snackbar>
    </Box>
  );
}
